ontact_information="연락처 정보를 남겨주세요 (필수).";mcs_input_device_password="기기 비밀번호 입력";msc_use_ethernet_cable_connect="네트워크 케이블을 사용하여 라우터와 장치의 네트워크 포트를 연결하십시오. 연결에 성공하면 장치가 자동으로 온라인 상태가됩니다.";mcs_choose_other_method_connect="구성이 실패했습니다. 다시 시도를 클릭하거나 다른 연결 방법을 선택하십시오.";mcs_not_hear_prompt_voice_no_symbol="음성 안내를 듣지 못했습니다.";mcs_upload_video="비디오를 올리다";mcs_upload_video_tip="클라우드 스토리지 스위치가 켜지면 시스템이 자동으로 클라우드 스토리지 보안 센터에 업로드하고 시스템 암호화 기술을 통해 비디오를 업로드하며 언제든지 사용하십시오";mcs_renew="갱신";mcs_package_type="패키지 유형";mcs_vbox_use_instruction="클라우드 스토리지 서비스 설명";mcs_unbind="풀다";mcs_seven_day_package="7 일 동안 클라우드 저장 기록";mcs_fifteen_day_package="15 일 동안 클라우드 저장 기록";mcs_thirty_day_package="30 일 동안 클라우드 저장 기록";mcs_fortyfive_day_package="45 일 롤링 클라우드 저장 기록";mcs_ninty_day_package="90 일 롤링 클라우드 저장 기록";mcs_get_cloud_info_fail="클라우드 저장 정보를 가져 오지 못했습니다.";mcs_unbind_success="성공을 풀다.";mcs_unbind_fail="풀어주지 못함";mcs_unbind_tip="번들 해제 후 클라우드 스토리지는 더 이상 비디오를 업로드하지 않습니다. 이전에 저장된 비디오는 클라우드 스토리지 서비스 시간이 만료되면 자동으로 삭제됩니다.";mcs_no_buy_vbox="클라우드 스토리지 서비스를 구입하지 않았습니다.";mcs_have_active_code_input="클라우드 저장소 활성화 코드";mcs_input_active_code="활성화 코드를 입력하십시오.";mcs_active_now="활성화 됨";mcs_active_fail="활성화 실패";mcs_active_success="활성화 완료";mcs_renew_success="갱신 성공";mcs_renew_fail="갱신 실패";mcs_active_code_empty="활성화 코드는 비워 둘 수 없습니다.";mcs_vbox_about="정보";mcs_clean_data="데이터 지우기";mcs_clean_data_tip="클라우드 저장소 데이터 지우기";mcs_vbox_id="클라우드 저장소 ID";mcs_bind_device="관련 장비";mcs_vbox_invalid_date="클라우드 저장소 만료일";mcs_upload_info="정보 업로드";mcs_can_choose_vbox_use="클라우드 스토리지 서비스를 구입했으며 일부 클라우드 스토리지는 무료이며 사용하도록 전환 할 수 있습니다";mcs_change_vbox="스위칭";mcs_change_vbox_success="클라우드 스토리지를 성공적으로 전환하십시오";mcs_change_vbox_fail="클라우드 저장소를 전환하지 못했습니다.";mcs_vbox_instruction="클라우드 스토리지 소개";mcs_vbox_instruction_text="클라우드 스토리지 기능은 움직이는 물체 감지와 같은 기술을 기반으로 카메라가 개발 한 비디오 저장 기능입니다. 카메라가 지나가는 사람이나 움직이는 물건과 같은 움직이는 이벤트를 감지하면 자동으로 비디오를 녹화하여 높은 암호화로 클라우드에 업로드하는 동시에 SD 카드 파괴로 인한 인위적인 파괴 및 키 데이터 손실을 효과적으로 방지합니다.";mcs_vbox_instruction_buy="클라우드 스토리지 구입 방법";mcs_vbox_instruction_buy_text="장치 - [설정] - [클라우드 스토리지] - [클라우드 스토리지 사용] - [클라우드 스토리지 공간 구입]을 선택하여 구매할 수 있습니다.";mcs_vbox_buy_tip_title="팁 :";mcs_vbox_buy_tip_text1="1) 클라우드 스토리지 서비스는 성공적인 구매 후 반환을 지원하지 않으며 환불을 지원하지 않습니다.";mcs_vbox_buy_tip_text2="2) 클라우드 스토리지는 구매 사용자에게만 바인딩되며 클라우드 스토리지 서비스가있는 장치는 삭제되고 새 계정이 추가됩니다. 새 계정에서는 장치가 클라우드 스토리지 서비스를 계속 즐길 수 없습니다.";mcs_how_calculate_service_time="클라우드 스토리지 구매 후 서비스 시간 계산";mcs_calculate_describe="구매가 성공적으로 이루어지고 활성화되면 클라우드 스토리지를 사용할 수 있으며 활성화 날에 서비스 시간을 계산하기 시작합니다. 예를 들어 2017 년 4 월 13 일에 7 일 동안 롤링 클라우드 스토리지 서비스를 구입했으며 활성화 날짜가 2017 년 4 월 14 일인 경우 서비스 종료 시간은 2017 년 5 월 14 일이고 스토리지는 2017 년 4 월 14 일에 시작됩니다. 2017 년 4 월 20 일 기준. 2017 년 4 월 21 일에 2017 년 4 월 14 일의 클라우드 저장 동영상이 자동으로 삭제되며, 2017 년 4 월 15 일부터 2017 년 4 월 21 일까지의 클라우드 저장 데이터가 보관되며 향후 일일 데이터가 삭제됩니다.";mcs_vbox_instruction_renew="클라우드 스토리지 갱신";mcs_vbox_instruction_renew_text1="1) 구입 한 클라우드 저장소가 만료 된 경우 다른 유형의 패키지 서비스를 갱신하거나 구입할 수 있습니다. 구매 활성화 후 새 클라우드 저장소 패키지가 즉시 적용됩니다.";mcs_vbox_instruction_renew_text2="2) 구입 한 클라우드 스토리지 서비스가 만료되지 않은 경우 동일한 패키지 서비스 (동일한 유형의 비디오 저장 기간)를 구매하면 새 서비스는 원래 서비스 시간으로 서비스 시간을 연장합니다.";mcs_vbox_instruction_renew_text3="3) 구입 한 클라우드 스토리지 서비스가 만료되지 않은 상태에서 새 패키지 서비스를 교체하려는 경우 다른 유형의 패키지 교체 서비스가 지원되지 않습니다. 클라우드 스토리지를 풀어야 새 클라우드 스토리지 서비스를 구매할 수 있습니다. 저장 장치를 정상적으로 사용할 수 있습니다.";mcs_vbox_instruction_reset="카메라 초기화";mcs_vbox_instruction_reset_text="카메라가 RESET 키를 10 초 동안 누르고 공장 설정을 복원하면 카메라와 클라우드 저장소가 연결 해제됩니다. 이력 데이터를 복원하려면 클라우드 저장소를 활성화해야합니다.";mcs_vbox_unbind="클라우드 스토리지 풀다운";mcs_vbox_unbind_text1="1) 클라우드 저장 공간과 카메라가 연결 해제 된 후 카메라의 비디오는 더 이상 저장되지 않으며 저장된 비디오는 서비스 시간이 만료되면 자동으로 삭제됩니다.";mcs_vbox_unbind_text2="2) 번들 해제 후에는 클라우드 저장소를 다른 카메라에 바인딩 할 수 있습니다. 다른 카메라를 바인딩 한 후에는 이전에 저장된 비디오가 다음주기 녹화 중에 삭제됩니다 .7 일 동안 구름 형 클라우드 스토리지 서비스를 구입 한 경우 클라우드 스토리지는 카메라 A에 바인딩되고 카메라 A보다 먼저 카메라 B에 바인딩됩니다. 저장된 7 일짜리 비디오는 루프 녹음 8 일째에 자동으로 삭제됩니다. 클라우드 스토리지 서비스 유형 및 만료 시간은 변경되지 않습니다.";mcs_vbox_choose="클라우드 저장소 선택";mcs_vbox_choose_text1="장치 - [설정] - [클라우드 저장소] - [클라우드 저장소 사용] - [클라우드 저장소 선택]을 선택하여";mcs_vbox_choose_text2="기기를 구매하고 클라우드 스토리지를 구매 한 경우 기기가 반환되었습니다 (참고 : 클라우드 스토리지 서비스를 구매 한 후에는 환불을 지원하지 않으므로 환불되지 않습니다) 기기와 클라우드 스토리지를 풀 수 있습니다. 클라우드 저장소는 새 기기에 바인딩됩니다.";mcs_vbox_choose_tip_text1="1) 클라우드 저장 및 계정 바인딩의 경우 동일한 계정 만 사용할 수 있습니다. 비어있는 클라우드 저장 장치와 바인딩 된 클라우드 저장 장치는 동일한 계정하에 있어야합니다.";mcs_vbox_choose_tip_text2="2) 클라우드 저장소 옵션은 무료 클라우드 저장소 공간이있는 경우에만 사용할 수 있습니다.";mcs_input_pwd="비밀번호를 입력하십시오.";mcs_bind_fail="장치 바인딩에 실패했습니다.";mcs_pwd_empty="비밀번호는 비워 둘 수 없습니다.";mcs_set_pwd_success="비밀번호 성공 설정";mcs_set_pwd_fail="비밀번호를 설정하지 못했습니다.";mcs_open_upload_yet="업로드 완료 됨";mcs_open_upload_fail="업로드를 열지 못했습니다.";mcs_close_upload_yet="폐쇄 된 업로드";mcs_close_upload_fail="닫기 닫기 실패";mcs_get_info_fail="정보를 가져 오는 데 실패했습니다.";mcs_set="설정";mcs_vbox_active="활성화 됨";mcs_unbinding="바인딩 해제 중 ...";mcs_activating="활성 ...";mcs_sending="요청 중 ...";mcs_changing="스위칭";mcs_unbind_yet="아직 장치를 바인딩하지 않았습니다.";mcs_nopermission_unbind="풀 수있는 권한이 없습니다.";mcs_purchase_vbox_space="클라우드 스토리지 구매";mcs_active_vbox_space="활성화 코드 사용";mcs_choose_vbox_space="클라우드 저장소 선택";mcs_reset_tip="카메라가 초기 설정으로 복원되었으며 클라우드 저장소와의 연결이 끊어졌습니다. 클라우드 저장소 데이터 수동 복원";mcs_overdue="만료 된";mcs_outofdate_to_renew="클라우드 저장소가 만료되었습니다. 구독을 갱신하십시오.";mcs_vbox_day="주간";mcs_until_outofdate="클라우드 저장소가 만료됩니다.";mcs_watch_vbox="클라우드 스토리지보기";mcs_vbox_open_time="영업 시간";mcs_expiration_date="만료 시간";mcs_remain_time="남은 시간";mcs_probation_vbox="클라우드 저장소 사용해보기";mcs_open_vbox="클라우드 저장소 사용";mcs_vbox_feedback="사용 중에 질문이 있으시면, 제발";mcs_active_tip_mall="활성화 버튼을 클릭하여 활성화하십시오.";mcs_pwd_set_tip="공유 암호 : 길이는 6 ~ 32 자, 문자 대소 문자, 특수 문자 조합";mcs_pwd_strong="암호 강도";mcs_share_tip="공유 된 사용자는 클라우드 저장소 비디오 만 볼 수 있고 클라우드 저장소에서는 다른 작업을 수행 할 수 없습니다.";mcs_strong="강한";mcs_pwd_length_tip="비밀번호는 6보다 작을 수 없습니다.";mcs_probation_now="지금 사용해보기";mcs_vbox_device_id="기기 ID :";mcs_effective_time="유효 시간 :";mcs_immediate_effect="즉시 효력을 발휘한다.";mcs_recoverying="복구 바인딩 ...";mcs_active_probation="평가판 활성화 중 ...";mcs_have_probation_yet_tip="평가판을 이미 시작 하셨으므로 이전에 클라우드 저장소를 바인딩하여 시도한 클라우드 저장소를 사용해보십시오.";mcs_recover